function updateIssue(t,e,o){{var s=window.location.pathname.split("/")[2],i="/issues/"+s+"/update/"+t,r={oldLabel:e,newLabel:o};$.ajax({url:i,type:"POST",data:r,success:function(t){return console.log(t),!0},error:function(t){return console.log("Error: "+JSON.parse(t)),!1}})}}for(var issueGroups=document.getElementsByClassName("issue-list-group"),from="",to="",fromMilestone="",toMilestone="",i=0;i<issueGroups.length;i++){var issueMilestone=issueGroups[i].getAttribute("data-milestone");Sortable.create(issueGroups[i],{group:"issue-"+issueMilestone,animation:150,dragable:".issue-list-item",ghostClass:"sortable-ghost",onStart:function(t){var e=t.item.parentNode;from=e.getAttribute("data-label"),fromGroup=e.getAttribute("data-milestone")},onEnd:function(t){var e=t.item.getAttribute("data-issue-number"),o=t.item.parentNode;to=o.getAttribute("data-label"),toGroup=o.getAttribute("data-milestone"),from!=to&&fromMilestone==toMilestone&&updateIssue(e,from,to)}})}